      {
        key: "9",
      },
      {
        key: "10",
      },
      {
        key: "7",
      },
      {
        key: "3",
      },
      {
        key: "14",
      },
      {
        key: "13",
      },
    ],
  };

  render() {
    return (
      <div className="App">
        <Blocks blocks={this.state.blocks.key} />
      </div>
    );
  }
}

export default App;
